import { Center, Slider, SliderFilledTrack, SliderThumb, SliderTrack, Text, VStack } from "@chakra-ui/react";
import React from "react";

function Nslider () {
  return(
    <Slider aria-label='slider-ex-1' defaultValue={30}>
      <SliderTrack>
        <SliderFilledTrack />
      </SliderTrack>
      <SliderThumb />
    </Slider>
  )
}

const Question2 = (): JSX.Element => (
  <div>
    <Center mt="64px">
      <Text fontSize='2xl'>0</Text>
      <VStack spacing="32px">
        <Text fontSize='4xl'>ASTRINGENCY</Text>
        <Nslider/>
      </VStack>
      <Text fontSize='2xl'>81</Text>
    </Center>
    <Center mt="64px">
      <Text fontSize='2xl'>0</Text>
      <VStack spacing="32px">
        <Text fontSize='4xl'>Body</Text>
        <Nslider/>
      </VStack>
      <Text fontSize='2xl'>81</Text>
    </Center>
  </div>
);
export default Question2;
